window.bookSummaryJSON = "<p>This military romance boxed set series includes all four Men of Honor stories: Fighting Temptation, Sweet Temptation, Resisting Temptation, and The Final Temptation. Best if in order, but all can be listened to as standalones!</p> <p>You will not break me for I am unbreakable. I will live with integrity, fight with honor and die for what's right.</p> <p>Precious lives were saved when three brave Navy SEALs went against orders, embarking on a rescue mission of their own. A mission that will never be forgotten and changed the course of their lives forever. While they will never regret their decision, it came with heavy consequence.</p> <p>Now they must fight to protect the women they love while also battling the new and existing demons that torture their souls, from death, corruption, destruction, and war. These men are strong, honorable, and will do everything they can to overcome the past that continues to haunt them.</p> <p>These are their stories.</p> <p>Contains mature themes.</p>"; 
